import React, {Component} from 'react';
import NavItem from "./NavItem";

const navItems = ["home", "back", "account", "logout"]

class Navbar extends Component {
    render() {
        return (
            <ul>
            {navItems.map(e => <li>{e}</li>)}
            </ul>
        )
    }
}
export default Navbar;
